/**
 * [description]
 * @Author   JohnNong
 * @Email    overkazaf@gmail.com
 * @Github   https://github.com/overkazaf
 * @DateTime 2016-06-27T10:02:31+0800
 *
 * 这个是程序主入口模块，程序中的所有模块交互都通过Dispatcher分发, 模块间解藕
 */
define(
	[
		'jquery', 
		'gridster' , 
		'ToolBar', 
		'ControlPanel',
		'PlayGround',
		'Dispatcher'
	], function (
		$, 
		gridster, 
		ToolBar, 
		ControllerPanel, 
		PlayGround, 
		Dispatcher) {
	
	function ChartBuilder(){};

	ChartBuilder.prototype = {
		constructor : ChartBuilder,
		init : function (){
			this.toolbar = new ToolBar();
			this.controlPanel = new ControllerPanel();
			this.playGround = new PlayGround();
			this.dispatcher = new Dispatcher(this.toolbar, this.controlPanel, this.playGround);

			// 启动dispatcher
			this.dispatcher.boot();
		}
	};

	return new ChartBuilder();
});
/**
 * [description]
 * @Author   JohnNong
 * @Email    overkazaf@gmail.com
 * @Github   https://github.com/overkazaf
 * @DateTime 2016-06-27T02:14:57+0800
 * 任务分发器， 这里起到中介者的作用，将应用中的所有命令托管给Dispatcher分发
 */
define(function (require){

	var $ = require('jquery');


	function Dispatcher(toolbar, ctrlPanel, playGround){
		this.__toolbar = toolbar;
		this.__ctrlPanel = ctrlPanel;
		this.__playGround = playGround;


	};


	var commandGroup = {
		'Grid' : {
			'add' : function (){},
			'remove' : function (){},
			'update' : function(){}
		},
		'Ctrl' : {

		},
		'Operation' : {

		}
	};

	var gridster;
	Dispatcher.prototype = {
		constructor : Dispatcher,
		init : function () {
			
			gridster = $('.gridster > ul').gridster({
				widget_margins:[5,5],
				widget_base_dimensions : [50,50],
				min_cols : 6,
				resize : {
					enabled : true
				}
			}).data('gridster');
		},
		boot : function () {
			this.init();
			$('#addLayout').on('click', function (){
				var widget = ['<li><h2>New Layout</h2></li>', 2,2];

				gridster.add_widget.apply(gridster, widget);
			});
		},
		watch : function (el) {

		}
	}


	return Dispatcher;
});
